        private static MIS_ETAInformationConfig buildETAInformationConfig(
            string scac, 
            string section, 
            string train_symbol, 
            string location_type, 
            string data_location, 
            string type_of_reporting, 
            string transmission_type,  
            string reporting_time, 
            string reporting_time_zone, 
            string current_crew_dest,  
            string eta_time, 
            string eta_time_zone            
        ) {

            MIS_ETAInformationConfig etaInformationConfig = new MIS_ETAInformationConfig();

            string temp = System.Environment.GetEnvironmentVariable("TEMP");
            System.DateTime now = System.DateTime.Now;

            MIS_ETAInformationConfigCONTENT content = new MIS_ETAInformationConfigCONTENT();
            content.SCAC = scac;
            content.SECTION = section;
            content.TRAIN_SYMBOL = train_symbol;
            content.ORIGIN_DATE = now.ToString("MMddyyyy");
            content.LOCATION_TYPE = location_type;
            content.DATA_LOCATION = data_location;
            content.TYPE_OF_REPORTING = type_of_reporting;
            content.TRANSMISSION_TYPE = transmission_type;
            
            DateTime reportingTime = now.AddMinutes(Convert.ToDouble(reporting_time));
            content.REPORTING_DATE = reportingTime.ToString("MMddyyyy");
            content.REPORTING_TIME = reportingTime.ToString("HHmm");
            content.REPORTING_TIME_ZONE = reporting_time_zone;
            content.CURRENT_CREW_DEST = current_crew_dest;
            
            DateTime etaTime = now.AddMinutes(Convert.ToDouble(eta_time));
            content.ETA_DATE = etaTime.ToString("MMddyyyy");
            content.ETA_TIME = etaTime.ToString("HHmm");
            content.ETA_TIME_ZONE = eta_time_zone;
            
            

            etaInformationConfig.CONTENT = content;

            return etaInformationConfig;
        }
        
