            string reporting_time, 
            string reporting_time_zone, 
            string current_crew_dest,  
            string eta_time, 
            string eta_time_zone, 
            string alert_event_key, 
            string device_id, 
            string ptas,
            string hostname
        ) {
            int receiver_port = 2500;
            MIS_ETAInformationConfig etaInformationConfig = buildETAInformationConfig(scac, section, train_symbol, location_type, data_location,
        	                                                                                         type_of_reporting, transmission_type, reporting_time, reporting_time_zone, current_crew_dest, eta_time, eta_time_zone);

            string temp = System.Environment.GetEnvironmentVariable("TEMP");
            XmlSerializer serializer;
            FileStream fs;
            string request = "";

            ETAInformationConfig etaInformationConfig1 = etaInformationConfig.toSerializableObject();
            fs = File.Create(temp+"/temp.request");
            serializer = new XmlSerializer(typeof(ETAInformationConfig));
            var writer = new SteXmlTextWriter(fs);
            serializer.Serialize(writer, etaInformationConfig1);
            fs.Close();

            request = File.ReadAllText(temp+"/temp.request");
            request = etaInformationConfig.toSteMessageHeader(request, true);
            
            using(TcpClient tcp = new TcpClient(hostname, receiver_port)) {
                NetworkStream nw = tcp.GetStream();
                nw.ReadTimeout = 5000; //5 second timeout for read response
                
                Byte[] data = System.Text.Encoding.ASCII.GetBytes(request); 
                Ranorex.Report.Info(String.Format("Encoding Message {0} for STE {1}:2500",request, hostname));
                nw.Write(data, 0, data.Length);
                
                Thread.Sleep(5);
                nw.Close();
