        	    header = "PASSTHRU,MWTHALT,";
        	}
        	else
        	{
        	    header = "RanorexAgent:PASSTHRU,MWTHALT,";
        	}
        	string result = header + serializedXml.Substring(from, to-from);
        	
        	return result;
        }
